import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';
import Typography from '@material-ui/core/Typography';
import IconButton from '@material-ui/core/IconButton';
import FacebookIcon from '@material-ui/icons/Facebook';
import TwitterIcon from '@material-ui/icons/Twitter';
import InstagramIcon from '@material-ui/icons/Instagram';

const useStyles = makeStyles((theme) => ({
  root: {
    backgroundColor: '#212121',
    color: '#fff',
    padding: theme.spacing(3),
  },
  iconButton: {
    color: '#fff',
  },
}));

function Footer() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <Grid container spacing={3} alignItems="center">
        <Grid item xs={12} sm={6}>
          <Typography variant="body1" component="p">
            Seb's Restaurant, 123 Main St, Anytown USA
          </Typography>
          <Typography variant="body1" component="p">
            Phone: 123-456-7890
          </Typography>
          <Typography variant="body1" component="p">
            Email: info@sebsrestaurant.com
          </Typography>
        </Grid>
        <Grid item xs={12} sm={6} container justify="flex-end">
          <IconButton className={classes.iconButton} aria-label="Facebook">
            <FacebookIcon />
          </IconButton>
          <IconButton className={classes.iconButton} aria-label="Twitter">
            <TwitterIcon />
          </IconButton>
          <IconButton className={classes.iconButton} aria-label="Instagram">
            <InstagramIcon />
          </IconButton>
        </Grid>
      </Grid>
    </div>
  );
}

export default Footer;
